import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
   <div>
   <ol>
   <h1> Hello, My Name Is Jatin Thakur </h1>

  <h2> <li> Todays date is 16/9/2020 </li></h2>
  <h2> <li> current time is 11:28:37 PM </li></h2>
   </ol>
   </div>,
   document.getElementById('root')
   );
